import { useState } from "react";

function ServiceNous() {
    const ServicesSection = () => {
        const [showText1, setShowText1] = useState(false);
        const [showText2, setShowText2] = useState(false);
        const [showText3, setShowText3] = useState(false);
        const [showText4, setShowText4] = useState(false);
    
        const handleShowText1 = () => setShowText1(!showText1);
        const handleShowText2 = () => setShowText2(!showText2);
        const handleShowText3 = () => setShowText3(!showText3);
        const handleShowText4 = () => setShowText4(!showText4);
    }
    return ( 
        <>
        <section>
            <div className="container-fluid">
                <div className="text-center">
                    <p className="display-4">Nos Services</p>
                    <p className="lead text-secondary" style={{ paddingBottom: "60px" }}>
                        WE CAMP offre
                    </p>
                </div>
                <div id="serc">
                    <div className="row">
                        <div className="col-md-3" style={{ paddingBottom: "60px" }}>
                            <img src="images/map.png" />
                            <p
                                style={{
                                    fontSize: "x-large",
                                    fontFamily: "'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif",
                                }}
                            >
                                Moyen de transport
                            </p>
                            <p className="lead text-secondary" style={{ textAlign: "justify" }}>
                                Notre association fournit des multiples moyens de transport tels que les{" "}
                                <span id="doc1">
                                    ...
                                </span>
                                {showText1 && (
                                    <span id="more1">
                                        {" "}
                                        bus ou bien les mini bus aussi comme nous sommes une association on a le droit de profiter d'un
                                        remise pour les trains et les metros notre objectif principal c'est de prenez soin du confort de
                                        notre visiteur.
                                    </span>
                                )}
                            </p>
                            <button id="btn1" onClick={handleShowText1}>
                                {showText1 ? "Masquer" : "Lire la suite"}
                            </button>
                        </div>
                        <div className="col-md-3" style={{ paddingBottom: "60px" }}>
                            <img src="images/guide.png" />
                            <p
                                style={{
                                    fontSize: "x-large",
                                    fontFamily: "'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif",
                                }}
                            >
                                Offre des guides
                            </p>
                            <p className="lead text-secondary" style={{ textAlign: "justify" }}>
                                Notre association fournit des guides réel et électronique bien selectioné{" "}
                                <span id="doc2">
                                    ...
                                </span>
                                {showText2 && (
                                    <span id="more2">
                                        {" "}
                                        et bien determiné quelque soit pour les guides réel qui offre des destination et des chemats
                                        attirant avec des programme bien orgainsé ou bien pour notre guide electronique qui offre des
                                        information sur le destionatin visité et la météo tous les jours.
                                    </span>
                                )}
                            </p>
                            <button id="btn2" onClick={handleShowText2}>
                                {showText2 ? "Masquer" : "Lire la suite"}
                            </button>
                        </div>
                        <div className="col-md-3" style={{ paddingBottom: "60px" }}>
                            <img src="images/Securite.png" />
                            <p style="font-size: 20px; font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;">Programmes bien organisé</p>
                            <p class="lead text-secondary" style="text-align: justify;">Notre association fournir des destinatin a visité on ajoutant des photos <span id="doc4">...</span><span id="more4">et des information sur cette place d'ou ces visites sont réel et bien organisé par notre association dans les dernier années ou mois.</span></p>
                            <button id="btn4" onclick="myyyyFunction()">Lire la suite</button>
                        </div>
                    </div>
                </div>
            </div>
        </section>
        
        </>
     );
}

export default ServiceNous;
